import React from 'react';
import './FromAirportIllustration.scss';

const FromAirportIllustration : React.FC = props => {
    return (
        <div className={`from-airport-illustration`}>
            <div className={`from-airport-illustration-part one`}>
                <div className={`from-airport-illustration-part-one-option-one`}></div>
                <div className={`from-airport-illustration-part-one-option-two`}></div>
            </div>
            <div className={`from-airport-illustration-part two`}>
                <div className={`from-airport-illustration-part-two-option-one`}></div>
                <div className={`from-airport-illustration-part-two-option-two`}></div>
            </div>
        </div>
    );
}

export default FromAirportIllustration;
